import React from 'react'


function Salaries(props){
  return(
    <li>
      <h2>{props.jobName}</h2>
      <p>25th Percentile:{props.jobSalary25} - 50th Percentile: {props.jobSalary50} - 75th percentile: {props.jobSalary75}</p>
    </li>
  )
}

export default Salaries;
